import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import BillingOperations from "./BillingOperations";
import Transaction from "./Transaction";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/billing" exact component={BillingOperations} />
        <Route path="/billing/cignal" component={Transaction} />
        <Route path="/billing/converge" component={Transaction} />
        <Route path="/billing/home-credit" component={Transaction} />
        <Route path="/billing/maynilad" component={Transaction} />
        <Route path="/billing/meralco" component={Transaction} />
        <Route path="/billing/pag-ibig" component={Transaction} />
        <Route path="/billing/pldt" component={Transaction} />
        <Route path="/billing/prulife" component={Transaction} />
        <Route path="/billing/skycable" component={Transaction} />
        <Route path="/billing/sunlife" component={Transaction} />
        {/* Add more routes for other billers as needed */}
      </Switch>
    </Router>
  );
};

export default App;
